import React from 'react';
import SvgIcon from '@components/svgIcon/SvgIcon';
import { Contact } from './ContactSection.styles';

const ContactSection = () => {
  return (
    <Contact>
      <SvgIcon src="/assets/static/icons/instagram.svg" height={20} width={20} />
    </Contact>
  );
};

export default ContactSection;
